import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Classrooms from './Components/Templates/Classrooms';

function App() {
  return (
      <BrowserRouter>
      <Routes>
        <Route path='/' element={<Classrooms />} />
      </Routes>
      </BrowserRouter>
  );
}

export default App;
